function getMappedFilters(data) {
  let customFilters = [];

  for (const [key] of Object.entries(data)) {
    if (key.includes("statement")) {
      const keyNumber = key.charAt(key.length - 1);
      const individualFilter = {
        statement: data["statement" + keyNumber],
        field: data["field" + keyNumber],
        value: data["value" + keyNumber],
      };

      customFilters.push(individualFilter);

    }
  }
  return customFilters;
}

function getCustomFields(data) {
  let availableSpots =
    ["custom_01", "custom_02", "custom_03"];
  let customFieldsTEE = {};

  for (const [key, value] of Object.entries(data)) {

    if (key.includes("custom_")) {

      customFieldsTEE[availableSpots[0]] = value;
      availableSpots.shift();
    }
  }
  return customFieldsTEE;
}

