function filterJobsList2(filter, jobs, status = true, value = "") {
  if (typeof filter === "undefined" || value.trim() === "") {
    jobsListState
      .setValue(jobs);
    return jobs
  }

  if (status) {
    const jobsList = jobs;

    for (const [key, value] of Object.entries(filter)) {
