          .status.toLowerCase() === "unsponsored" ? 0 : filter
          .status.toLowerCase() === "sponsored" ? 1 : 2

        const jobsListFiltered = jobsList.filter((job) => {
          return job.status === mappedStatus;
        });
        return jobsListFiltered
      }
    }

    return;
  }

  const jobsListFiltered = [];


  jobs.forEach(job => {
    for (const word of filter) {

      if (job[word].toLowerCase().includes(value.toLowerCase())) {
        jobsListFiltered.push(job);
        return;
      }
    }
  });

  return jobsListFiltered;

}

