const pubs = data?.publishersList?.items ?? [];

const modifiedPubs = pubs.map(pub => {
  let bot_clicks = 0;
  let clicks = [];
  let total_spend = 0;
  let cpcs_total = 0;
  let total_bids = 0;
  let total_apps = 0;
  const feeds = pub?.feed?.items ?? [];

  feeds.forEach(feed => {
    const bid = feed.bid ?? undefined;
    if (bid) {
      const cpc = bid.cpc ?? 0;
      total_bids++;
      cpcs_total += cpc;
      if (bid.app) {
        total_apps += bid.app.count;
      }
    }

    if (bid && bid?.click) {
      const cpc = bid.cpc ?? 0;
      const _clicks = bid.click?.items ?? [];

      clicks = [...clicks, ..._clicks];

      clicks.forEach(click => {
        total_spend += cpc;
        if (click.bot) {
          bot_clicks++;
        }
      });
    }
  });

  return {
    ...pub, bot_clicks,
    total_clicks: clicks.length,
    total_spend,
    average_cpc: !total_bids ? 0 : cpcs_total / total_bids,
    average_cpa: !total_apps ? 0 : total_spend / total_apps,
    total_apps
  };
});

return modifiedPubs;

