args.transformer:
const jobGroups = data?.jobGroupsList?.items ?? [];

const jobGroupsModified = [];
const jobGroupStats = {
  unsponsored: 0,
  sponsored: 0,
  paused: 0,
  archived: 0,
};
const jobStats = {
  unsponsored: 0,
  sponsored: 0,
  paused: 0,
  archived: 0,
};

const statusConverter = {
  0: "unsponsored",
  1: "sponsored",
  2: "paused",
  3: "archived"
}

jobGroups.forEach(jobGroup => {
  const _jobGroup = { ...jobGroup };
  const generalStats = {
    totalClicks: 0,
    totalApps: 0,
    totalSpent: 0,
  };
  const pubStats = {};
  const pubsInJobGroup = jobGroup?.publisherJobgroup?.items ?? [];

  jobGroupStats[jobGroup.status] = jobGroupStats[jobGroup.status] + 1;

  if (jobGroup.jobs && jobGroup.jobs.count) {
    const _jobs = jobGroup.jobs.items;
    _jobs.forEach(job => {
      jobStats[statusConverter[job.status]] =
        jobStats[statusConverter[job.status]] + 1;

      const _bids = job.bid?.items ?? [];

      _bids.forEach(bid => {
        const _clicks = bid?.click?.count ?? 0;
        const _apps = bid?.app?.count ?? 0;
        const model = bid.cost_model ?? "";
        let _bidCost = 0;

        if (model === "CPC") {
          _bidCost = _clicks * bid.cost;
        } else if (model === "CPA") {
          _bidCost = _apps * bid.cost;
        }

        generalStats.totalClicks = generalStats.totalClicks + _clicks;
        generalStats.totalApps = generalStats.totalApps + _apps;
        generalStats.totalSpent = generalStats.totalSpent + _bidCost;

        const pubName = bid?.publisher?.name ?? "";
        const pubId = bid?.publisher?.id ?? "";
        const pubCostModel = bid?.cost_model ?? "";
        const pubCost = bid?.cost ?? 0;
        const pubClicks = pubStats[pubName]?.clicks ?? 0;
        const pubApps = pubStats[pubName]?.apps ?? 0;
        const pubJobs = pubStats[pubName]?.jobs ?? 0;

        const pubRelationInfo = pubsInJobGroup.find(pub => {
          return pub.publisher.name === pubName;
        });

        pubStats[pubName] = {
          id: pubId,
          name: pubName,
          spend_goal: pubRelationInfo?.spend_goal ?? 0,
          costModel: pubCostModel,
          cost: pubCost,
          clicks: pubClicks + _clicks,
          apps: pubApps + _apps,
          jobs: pubJobs + 1
        }
      });

    });
  }

  const jobGroupModified = {
    ..._jobGroup,
    ...generalStats,
    pubStats
  }

  jobGroupsModified.push(jobGroupModified);

});

let newData = {
  items: jobGroupsModified,
  count: 0,
  jobGroupStats,
  jobStats
}

return newData;

