args.transformer:
let dataCopy = { ...data };
let _clientsList = dataCopy?.clientsList?.items ?? [];
let clientsArray = [];

_clientsList.forEach(client => {
  let clientCopy = { ...client };
  let feeds = clientCopy.feeds?.items ?? [];
  let totalFeedsSpent = 0;
  let spentText = "";

  feeds.forEach(feed => {
    let bid = feed.bid ?? {};
    let totalBidsSpent = 0;

    if (bid.id) {
      totalBidsSpent = bid.cost * bid.click.count;
    }

    totalFeedsSpent = totalFeedsSpent + totalBidsSpent;
  });

  if(!client.spend_goal || client.spend_goal === 0){
    spentText = "Unlimited"
  }else if(totalFeedsSpent === 0){
    spentText = `\$${client.spend_goal} (0%)`;
  }else{
    let percentage = client.spend_goal / totalFeedsSpent;
    spentText = `\$${client.spend_goal} (${percentage.toFixed(2)}%)`;
  }

  clientsArray.push(
    {
      ...clientCopy,
      totalSpent: totalFeedsSpent,
      spentText
    }
  );
});

return clientsArray;

