query clientsList {
  clientsList {
    items {
      id
      name
      client_id 
      status
      spend_goal
      contact_name
      email
      feeds{
      	items{
          id
          bid{
            id
            cost
            click{
              count
            }
          }
        }
      }
    }
  }
}

query jobGroup($id:ID!) {
  jobGroup(id: $id) {
    id
    name
    jobs {
      items {
        id
        status
        ref_no
        title
        company
        state
        city
        postal_code
        bid{
          count
          items{
            id
            publisher{
              id
              name
            }
          }
        }
      }
      count
    }
  }
}

